te de l'espérance de vie minimale montre peut-être que les systèmes/technologies de santé progressent ou que l'accessibilité aux systèmes de santé augmente.\n\n#Une lente augmentation de l'espérance de vie maximale montre qu'il n'existe pas encore de nouvelle technologie pour augmenter l'espérance de vie maximale et que les conditions de vie s'améliorent ou que le système de santé ne voit aucune nécessité de développement au-delà de 80 ans.\n\nhist(data_all_national_dropped$Expectancy,xlab='Expectancy')\n\n#Il a une asymétrie négative. La moyenne est plus petite que la médiane. \n#Avec les statistiques ci-dessous, nous pouvons dire que vous verrez très probablement votre 70e-75e anniversaire.","metadata":{"execution":{"iopub.status.busy":"2022-03-20T10:29:24.897199Z","iopub.execute_input":"2022-03-20T10:29:24.898917Z","iopub.status.idle":"2022-03-20T10:29:25.316148Z"},"trusted":true},"execution_count":30,"outputs":[{"name":"stderr","text":"The following objects are masked from data_all_national_droped (pos = 3):\n\n    Country, Country_Code, Expectancy, Level, Year\n\n\nThe following objects are masked from data_all_national_droped (pos = 4):\n\n    Country, Country_Code, Expectancy, Level, Year\n\n\nThe following objects are masked from data_all_national_droped (pos = 5):\n\n    Country, Country_Code, Expectancy, Level, Year\n\n\nThe following objects are masked from data_all_national_droped (pos = 6):\n\n    Country, Country_Code, Expectancy, Level, Year\n\n\nThe following objects are masked from data_all_national_droped (pos = 7):\n\n    Country, Country_Code, Expectancy, Level, Year\n\n\nThe following objects are masked from data_all_national_droped (pos = 8):\n\n    Country, Country_Code, Expectancy, Level, Year\n\n\nThe following objects are masked from data_all_national_droped (pos = 9):\n\n    Country, Country_Code, Expectancy, Level, Year\n\n\nThe following objects are masked from data_all_national_droped (pos = 10):\n\n    Country, Country_Code, Expectancy